/// - OR -

/// Get a stream of results.
///
/// This allows you to paginate through all the items.
use futures_util::TryStreamExt;
async fn example_api_calls_list_stream() -> anyhow::Result<()> {
    let client = kittycad::Client::new_from_env();
    let mut api_calls = client.api_calls();
    let mut stream = api_calls.list_stream(
        Some(4 as u32),
        Some(kittycad::types::CreatedAtSortMode::CreatedAtAscending),
    );
    loop {
        match stream.try_next().await {
            Ok(Some(item)) => {
                println!("{:?}", item);
            }
            Ok(None) => {
                break;
            }
            Err(err) => {
                return Err(err.into());
            }
        }
    }

    Ok(())
}

